$primary-color: #5f9cd1;
$secondary-color: #507CA1;
$tertiary-color: #7E9FA6;
$white-color: #F8F8F8;
$light-gray-color: #d4d4d4;
$gray-color: #4e4e4e;
$dark-gray-color: #212121;
$green-color: #47A65C;
$yellow-color: #E2964D;
$orange-color: #F09033;
$red-color: #DF5656;
$background-color: #F8F8F8;
$modal-background-color: rgba($primary-color, 0.5);

$tablet-breakpoint: 768px;
$desktop-breakpoint: 1024px;
$large-desktop-breakpoint: 1400px;

$primary-box-shadow: 10px 10px 20px rgba($color: #898989, $alpha: 0.7);
